import React from "react";
import ReactDOM from "react-dom";

import TodosContextProvider from "./store/todos-context";

import "./index.css";
import App from "./App";
import Todos from "./components/Todos";

ReactDOM.render(
  <TodosContextProvider>
    <App />
  </TodosContextProvider>,
  document.getElementById("root")
);
